INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 1, 1, 2, "2025/01/31 12:00:00", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", "カリン", -416.5, 0.0, 1000001, 62, "2030/01/01 14:59:59", 3.414, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 1, 2, 2, "2025/01/31 12:00:00", "ミッションをクリアして、\n報酬をゲットしましょう！", "カリン", -416.5, 0.0, 1000002, 62, "2030/01/01 14:59:59", 3.099, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 1, 3, 2, "2025/01/31 12:00:00", "受け取ることができる\n報酬があるようです\n確認してみてください", "カリン", -416.5, 0.0, 1000003, 63, "2030/01/01 14:59:59", 2.801, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 1, 4, 2, "2025/01/31 12:00:00", "報酬がもらえますよ！\nチェックしてみてください", "カリン", -416.5, 0.0, 1000004, 63, "2030/01/01 14:59:59", 0.0, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 1, 5, 1, "2025/01/31 12:00:00", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "カリン", -363.0, 0.0, 1000005, 64, "2030/01/01 14:59:59", 2.12, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 1, 6, 2, "2025/01/31 12:00:00", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "カリン", -363.0, 0.0, 1000006, 64, "2030/01/01 14:59:59", 1.68, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 1, 7, 1, "2025/01/31 12:00:00", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "カリン", -363.0, 0.0, 1000007, 64, "2030/01/01 14:59:59", 2.33, 190801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 10201, 101, 7, "2025/01/31 12:00:00", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "ラビリスタ", -285.0, -6.0, 1020101, 61, "2030/01/01 14:59:59", 5.18, 133701);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10201, 201, 2, "2025/01/31 12:00:00", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "クリスティーナ", -285.0, -2.0, 1020102, 61, "2030/01/01 14:59:59", 8.77, 133901);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6, 10201, 301, 1, "2025/01/31 12:00:00", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "ネネカ", -285.0, 0.0, 1020103, 61, "2030/01/01 14:59:59", 15.5, 133801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 10202, 101, 5, "2025/02/28 12:00:00", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "ランファ", -285.0, 0.0, 1020201, 61, "2030/01/01 14:59:59", 9.061, 134301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10202, 201, 2, "2025/02/28 12:00:00", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "チカ", -285.0, 0.0, 1020202, 61, "2030/01/01 14:59:59", 7.699, 134401);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10203, 101, 2, "2025/03/31 12:00:00", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "アオイ", -285.0, 0.0, 1020301, 61, "2030/01/01 14:59:59", 8.595, 134601);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10203, 201, 2, "2025/03/31 12:00:00", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "クローチェ", -285.0, 0.0, 1020302, 61, "2030/01/01 14:59:59", 7.758, 134501);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 10204, 101, 6, "2025/04/30 12:00:00", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "ルイズマリー", -285.0, 0.0, 1020401, 61, "2030/01/01 14:59:59", 7.0, 132302);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10204, 201, 2, "2025/04/30 12:00:00", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "イロハ", -285.0, 0.0, 1020402, 61, "2030/01/01 14:59:59", 7.904, 132402);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 10204, 301, 2, "2025/04/30 12:00:00", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "ソノ", -285.0, 0.0, 1020403, 61, "2030/01/01 14:59:59", 8.487, 132502);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10205, 101, 2, "2025/05/31 12:00:00", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "カノン", -285.0, 0.0, 1020502, 61, "2030/01/01 14:59:59", 8.763, 134901);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10205, 201, 3, "2025/05/31 12:00:00", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "ツムギ", -285.0, 0.0, 1020503, 61, "2030/01/01 14:59:59", 6.417, 134801);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 10206, 101, 7, "2025/06/30 12:00:00", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "エリス", -285.0, 0.0, 1020601, 61, "2030/01/01 14:59:59", 10.335, 135001);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 10206, 201, 4, "2025/06/30 12:00:00", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "シェフィ", -285.0, 0.0, 1020602, 61, "2030/01/01 14:59:59", 6.281, 135101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10206, 301, 2, "2025/06/30 12:00:00", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "プレシア", -285.0, 0.0, 1020603, 61, "2030/01/01 14:59:59", 12.244, 135201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 10207, 101, 8, "2025/07/31 12:00:00", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "クリア", -285.0, 0.0, 1020701, 61, "2030/01/01 14:59:59", 6.339, 135301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7, 10207, 201, 9, "2025/07/31 12:00:00", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "アネモネ", -285.0, 0.0, 1020702, 61, "2030/01/01 14:59:59", 8.184, 135401);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (9, 10208, 101, 2, "2025/08/31 12:00:00", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "アイラ", -285.0, 0.0, 1020801, 61, "2030/01/01 14:59:59", 3.906, 129101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10208, 201, 2, "2025/08/31 12:00:00", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "シナツ", -285.0, 0.0, 1020802, 61, "2030/01/01 14:59:59", 14.465, 129201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 10208, 301, 3, "2025/08/31 12:00:00", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "ヒヨリ", -285.0, 0.0, 1020803, 61, "2030/01/01 14:59:59", 8.662, 100101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10208, 401, 3, "2025/08/31 12:00:00", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "レイ", -285.0, 0.0, 1020804, 61, "2030/01/01 14:59:59", 10.915, 100301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 10209, 101, 7, "2025/09/30 12:00:00", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "ユキノ", -285.0, 0.0, 1020901, 61, "2030/01/01 14:59:59", 6.042, 135802);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 10209, 201, 1, "2025/09/30 12:00:00", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "サツキ", -285.0, 0.0, 1020902, 61, "2030/01/01 14:59:59", 9.402, 135903);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8, 10209, 301, 1, "2025/09/30 12:00:00", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "ルルィ", -285.0, 0.0, 1020903, 61, "2030/01/01 14:59:59", 8.16, 136902);
